import React from "react";
import HomeTwoToneIcon from "@material-ui/icons/HomeTwoTone";

function Home() {
  return (
    <>
      <HomeTwoToneIcon
        style={{ margin: "auto", filter: "drop-shadow(0 0 0.25rem #d8d8e2)" }}
        color="secondary"
      />
    </>
  );
}

export default Home;
